        <meta charset="utf-8">

        <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/h5p/ajax?action=","contents":{"cid-741515567":{"displayOptions":{"copy":false,"copyright":false,"embed":false,"export":false,"frame":false,"icon":false},"fullScreen":"1","jsonContent":"{\"iconType\":\"icon\",\"icon\":\"plus\",\"color\":\"#981d99\",\"hotspots\":[{\"position\":{\"x\":71.23914046215586,\"y\":27.69706865755977},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Era lunes por la mañana y Ana se dio cuenta de que había despertado tarde. Sabía que tenía que preparar su mochila para el día escolar, pero si no lo hacía de manera organizada, podría olvidar algo importante. Decidió <strong>dividir </strong>la tarea en pasos <strong>más pequeños</strong> para ser más eficiente y no perder tiempo.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"es\",\"license\":\"U\",\"title\":\"Sin título es\",\"authors\":[],\"changes\":[]},\"subContentId\":\"e90d7991-ba35-4d16-827c-53be84d6e178\"}],\"header\":\"La Preparación para el Día Escolar\"},{\"position\":{\"x\":49.0626429770164,\"y\":22.195112725071873},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Paso 1:</strong> Ana mira su horario escolar para asegurarse de qué asignaturas tiene ese día y qué materiales necesita.</p><p><strong>Recuerda: Descomponer </strong>la tarea de preparar la mochila comienza por entender lo que necesitas. Al revisar tu horario, <strong>divides el problema en partes pequeñas.</strong></p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"es\",\"license\":\"U\",\"title\":\"Sin título es\",\"authors\":[],\"changes\":[]},\"subContentId\":\"ce921b79-06cf-4ad7-9469-60d47eb98772\"}]},{\"position\":{\"x\":49.0626429770164,\"y\":35.43463458919655},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Paso 2: </strong>Ana selecciona los libros y cuadernos que necesita para las clases del día y los coloca en su mochila.</p><p><strong>Recuerda: </strong>En lugar de meter todo a la vez, primero organizas los libros y cuadernos. Esto es <strong>descomponer la tarea </strong>de preparación en un <strong>paso específico</strong>, para asegurarte de que no te olvidas de lo más importante.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"es\",\"license\":\"U\",\"title\":\"Sin título es\",\"authors\":[],\"changes\":[]},\"subContentId\":\"c49e1ed5-9dad-40c4-a334-cb27fdfb0247\"}]},{\"position\":{\"x\":49.0626429770164,\"y\":49.12808291723408},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Paso 3: </strong>Ana coloca lápices, borradores, marcadores y otras herramientas necesarias en su estuche.</p><p><strong>Recuerda: </strong>Aquí <strong>divides la tarea</strong> en aún más<strong> partes pequeñas</strong>: lápices, borradores, reglas y otros materiales. Esto hace que sea <strong>más fácil </strong>ver qué necesitas exactamente y evitar llevar cosas innecesarias</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"es\",\"license\":\"U\",\"title\":\"Sin título es\",\"authors\":[],\"changes\":[]},\"subContentId\":\"4e4681c0-a3ea-4d07-916d-54e779881bc1\"}]},{\"position\":{\"x\":49.0626429770164,\"y\":62.437588805275},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Paso 4: </strong>Ans coloca su almuerzo en su mochila, asegurándose de que esté bien cerrado y listo.</p><p><strong>Recuerda: Descomponer </strong>esta tarea significa separar el almuerzo y asegurarte de que esté listo con calma. <strong>Al hacerlo por separado</strong>, evitas que se mezcle con otras cosas y puedes revisarlo para que esté bien cerrado</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"es\",\"license\":\"U\",\"title\":\"Sin título es\",\"authors\":[],\"changes\":[]},\"subContentId\":\"f7db6719-9e32-4474-9c70-f6dbec71e536\"}]},{\"position\":{\"x\":49.0626429770164,\"y\":75.75843546678772},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Paso 5: </strong>Ana revisa su mochila para asegurarse de que no olvida nada importante</p><p><strong>Recuerda: </strong>Finalmente, una vez que has hecho todo <strong>paso a paso</strong>, la revisión te permite ver si has olvidado algo importante. <strong>Al descomponerlo en pasos pequeños</strong>, es <strong>más fácil</strong> verificar cada parte por separado y corregir si falta algo.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"es\",\"license\":\"U\",\"title\":\"Sin título es\",\"authors\":[],\"changes\":[]},\"subContentId\":\"aae171a3-9c00-409b-b50b-032c09fbff0b\"}]}],\"hotspotNumberLabel\":\"Punto clave #num\",\"closeButtonLabel\":\"Cerrar\",\"containsAudioVideoLabel\":\"Contains Audio/Video\",\"image\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABAAAAAMACAYAAAC6uhUNAAAACXBIWXMAAA7EAAAOxAGVKw4bAAAEz2lUWHRYTUw6Y29tLmFkb2JlLnhtcAAAAAAAPD94cGFja2V0IGJlZ2luPSfvu78nIGlkPSdXNU0wTXBDZWhpSHpyZVN6TlRjemtjOWQnPz4KPHg6eG1wbWV0YSB4bWxuczp4PSdhZG9iZTpuczptZXRhLyc+CjxyZGY6UkRGIHhtbG5zOnJkZj0naHR0cDovL3d3dy53My5vcmcvMTk5OS8wMi8yMi1yZGYtc3ludGF4LW5zIyc+CgogPHJkZjpEZXNjcmlwdGlvbiByZGY6YWJvdXQ9JycKICB4bWxuczpBdHRyaWI9J2h0dHA6Ly9ucy5hdHRyaWJ1dGlvbi5jb20vYWRzLzEuMC8nPgogIDxBdHRyaWI6QWRzPgogICA8cmRmOlNlcT4KICAgIDxyZGY6bGkgcmRmOnBhcnNlVHlwZT0nUmVzb3VyY2UnPgogICAgIDxBdHRyaWI6Q3JlYXRlZD4yMDI1LTA2LTIyPC9BdHRyaWI6Q3JlYXRlZD4KICAgICA8QXR0cmliOkV4dElkPmMyYjYyZTU2LThhMTYtNGM1Yi05ZjkxLWRmMTY3YTY3ZmRlZDwvQXR0cmliOkV4dElkPgogICAgIDxBdHRyaWI6RmJJZD41MjUyNjU5MTQxNzk1ODA8L0F0dHJpYjpGYklkPgogICAgIDxBdHRyaWI6VG91Y2hUeXBlPjI8L0F0dHJpYjpUb3VjaFR5cGU+CiAgICA8L3JkZjpsaT4KICAgPC9yZGY6U2VxPgogIDwvQXR0cmliOkFkcz4KIDwvcmRmOkRlc2NyaXB0aW9uPgoKIDxyZGY6RGVzY3JpcHRpb24gcmRmOmFib3V0PScnCiAgeG1sbnM6ZGM9J2h0dHA6Ly9wdXJsLm9yZy9kYy9lbGVtZW50cy8xLjEvJz4KICA8ZGM6dGl0bGU+CiAgIDxyZGY6QWx0PgogICAgPHJkZjpsaSB4bWw6bGFuZz0neC1kZWZhdWx0Jz5EaXNlw7FvIHNpbiB0w610dWxvIC0gMTwvcmRmOmxpPgogICA8L3JkZjpBbHQ+CiAgPC9kYzp0aXRsZT4KIDwvcmRm
